import React from "react";
import { BsFillBackspaceFill } from "react-icons/bs";

const Movie = ({ movie }) => {
  return (
    <div className="bg-warning rounded m-2">
      <div className="d-flex justify-content-between"></div>
      <div>
        <h4 className=" d-flex justify-content-between p-3">
          {movie.name}
          {movie.priority === true && <span className="text-danger">*</span>}
          <> </>
          <BsFillBackspaceFill />
        </h4>
      </div>
      <div className="font-weight-bold"></div>
    </div>
  );
};

export default Movie;
